import { FC } from "react";

interface TabsButtonsProps {
  buttons: {
    id: string;
    name: string;
  }[];
}

const TabsButtons: FC<TabsButtonsProps> = ({ buttons }) => {
  return (
    <div>
      <div></div>
      {buttons.map((button) => {
        return (
          <div key={button.id}>
            <p>{button.name}</p>
          </div>
        );
      })}
    </div>
  );
};

export default TabsButtons;
